/* eslint no-unused-vars: 0 */
import { ifDefined } from "lit-html/directives/if-defined.js";
import { html, svg, repeat, classMap, styleMap, unsafeHTML, scopeTag } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';

const main = (context, tags, suffix) => {
	const block0 = (context) => { return html`<div class="ui5-progress-indicator-root ${classMap(context.classes.root)}" dir="${ifDefined(context.effectiveDir)}" role="progressbar" aria-valuemin="0" aria-valuenow="${ifDefined(context.validatedValue)}" aria-valuemax="100" aria-valuetext="${ifDefined(context.valueStateText)}" aria-disabled="${ifDefined(context._ariaDisabled)}"><div class="ui5-progress-indicator-bar" style="${styleMap(context.styles.bar)}">${ !context.showValueInRemainingBar ? block1(context) : undefined }</div><div class="ui5-progress-indicator-remaining-bar">${ context.showValueInRemainingBar ? block4(context) : undefined }</div></div>`; };
const block1 = (context) => { return html`${ context.showIcon ? block2(context) : undefined }${ !context.hideValue ? block3(context) : undefined }`; };
const block2 = (context) => { return html`<${scopeTag("ui5-icon", tags, suffix)} name="${ifDefined(context.valueStateIcon)}" class="ui5-progress-indicator-icon"></${scopeTag("ui5-icon", tags, suffix)}>`; };
const block3 = (context) => { return html`<span class="ui5-progress-indicator-value">${ifDefined(context.validatedValue)}%</span>`; };
const block4 = (context) => { return html`${ context.showIcon ? block5(context) : undefined }${ !context.hideValue ? block6(context) : undefined }`; };
const block5 = (context) => { return html`<${scopeTag("ui5-icon", tags, suffix)} name="${ifDefined(context.valueStateIcon)}" class="ui5-progress-indicator-icon"></${scopeTag("ui5-icon", tags, suffix)}>`; };
const block6 = (context) => { return html`<span class="ui5-progress-indicator-value">${ifDefined(context.validatedValue)}%</span>`; };


	return block0(context);
};

export default main;
